import React from "react";
import { Icon } from '@iconify/react';
import validator from 'validator';
import axios, * as others from 'axios';
import { useNavigate } from "react-router-dom";
// import { NavigationContainer } from '@react-navigation/native';
// import { createNativeStackNavigator } from '@react-navigation/native-stack';
import {useLocation} from 'react-router-dom';



 
function GetInfo() {
    const location = useLocation();
    console.log(location.state);

    // const {param} = route;
    const entries = Object.entries(location.state.operations);
    entries.splice(0,1);
    entries.splice(0,1);
    // console.log(entries);
    const listKeys = entries.map((el) =>
  <li>{el[0]}</li>);

  const op = Object.entries(location.state.operations);

  console.log(op);
  op =  op.map(o => o[1] );
  console.log()
//   const listVal = op.map((el) =>
// <li>{el[0]}</li>)

const listOp = (ops) => {
    return ops.map(o => <li key={o[0]}>{o[1]}</li>  )
  }


    return (
        <section className="get-info">
            <div className='get-info-content' >
                <div className="get-info-header">
                    <h2>SÄ…skaitos numeris: </h2>
                    <p className="sask-num">{location.state.card.number}</p>
                </div>
                <div className="get-info-main">
                    <ul>{listKeys}</ul>
                </div>
                <ul>
                    {listOp(op)}
                </ul>
            </div>
        </section>
    );
}
 
export default GetInfo;
